import React from 'react'
import '../pages-styles/contact.css'
import Navbar from '../component/Navbar';
import HeadingText from '../component/HeadingText';
function Contact () {
  return <>
    <Navbar/>
    <HeadingText text="Contact"/>
    </>
}

export default Contact;
